  //   }
  // }, [jwt, data])

  useEffect(() => {
    if (active) {
      setActive(!active)
    }
  }, [active])

  useEffect(()=>{
        fetchData(STUDENT_DATA)
    },[])

  return (
    <>
      <NavBar />
     <Title title="Student Data"/>
     <DashboardBtns />
     <Table getdata = {getdata} smessages = {smessages}/>
      {active ? <Modal /> : ""}
    </>
  )
}

export default Dashboard
